import React, { Component } from 'react';

class Order extends Component {
  render() {
    return(
      <div className='OrderMenu'>
        <div className="ordercontent">
          <div className="subtotal">
            <h4>Subtotal</h4>
            <p>Price</p>
          </div>
          <div className="tax">
            <h5>Tax</h5>
            <p>Tax Price</p>
          </div>
        </div>
      </div>
    )
  }
}

export default Order
